INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (14, "ミヤコ（ハロウィン）", 0, "悪魔偽王国軍（ディアボロス）", "魔族", 23, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", 130, "プリンを食べること", "B", "雨宮天", 108201, 1, "プリン大好きゴースト娘", 32, 7);
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (11, "ミサキ（ハロウィン）", 0, "ルーセント学院", "魔族", 3, "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", 120, "ファッション誌鑑賞、コスメ集め", "A", "久野美咲", 108301, 1, "ちょっとおませな恋に恋する女の子", 22, 14);
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (17, "チカ（クリスマス）", 0, "カルミナ", "ヒューマン", 3, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", 163, "各種楽器", "O", "福原綾香", 108401, 6, "人々を守るために歌う、唱喚士の少女", 46, 4);
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (12, "クルミ（クリスマス）", 0, "サレンディア救護院", "ヒューマン", 9, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", 150, "観劇、おままごと", "B", "植田佳奈", 108501, 6, "泣き虫で臆病な守ってあげたい女の子", 40, 9);
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (14, "アヤネ（クリスマス）", 0, "サレンディア救護院", "ヒューマン", 10, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", 148, "屋内でできる遊び", "B", "芹澤優", 108601, 5, "ぷうきちといつも一緒！", 38, 9);
