INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (17, "ユイ（ニューイヤー）", 0, "トゥインクルウィッシュ", "ヒューマン", 5, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", 158, "料理、人間観察", "O", "種田梨沙", 108801, 4, "戦闘のサポートが得意な、心優しい少女", 47, 2);
