INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (16, "エリコ（バレンタイン）", 0, "トワイライトキャラバン", "魔族", 30, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", 154, "実験、裁縫、料理", "B", "橋本ちなみ", 109001, 7, "運命の相手に一途すぎる乙女", 43, 13);
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (18, "シズル（バレンタイン）", 0, "ラビリンス", "ヒューマン", 24, "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", 168, "家事全般", "O", "生天目仁美", 109101, 10, "お姉ちゃんがお世話してあげるからねっ！", 54, 3);
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (17, "アン", 0, "？？？", "ヒューマン", 1, "私はアン！一応、マナリア王国の\n第一王女だけど…あまりかしこまらないで、\n気軽に仲良くしてくれたら嬉しいな！", 156, "読書", "AB", "日笠陽子", 109201, 12, "英霊と契約を結んだマナリアの天才王女", 55, "");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (15, "ルゥ", 0, "？？？", "ヒューマン", 4, "ルゥはルゥですぅ！マナリア魔法学院に\n通ってるですぅ。あなたもルゥの\nお友だちになってくれるですか？", 144, "食べること、眠ること", "O", "こやまきみこ", 109301, 2, "マナリア魔法学院の新入生", 45, "");
